/**
 * Doubly linked list implementation
 * making use of dummy nodes for the
 * sake of simplicity.
 */

export function TestList() {
	this.front = new Node(null, null, null);
	this.back = new Node(this.front, null, null);
	this.front.next = this.back;
	this.length = 0;
}

export function Node(prev, next, value) {
	this.prev = prev;
	this.next = next;
	this.value = value;
}

export function Iterator(front, back, current) {
	this.front = front;
	this.back = back;
	this.current = current;
}

export function ReverseIterator(front, back, current) {
	this.front = front;
	this.back = back;
	this.current = current;
}

TestList.prototype.insertAfter = function (iterator, value) {
	const prev = iterator.current;

	const node = new Node(prev, prev.next, value);
	prev.next.prev = node;
	prev.next = node;

	++this.length;
	return this.iterator(node);
};

TestList.prototype.insertBefore = function (iterator, value) {
	const next = iterator.current;

	const node = new Node(next.prev, next, value);
	next.prev.next = node;
	next.prev = node;

	++this.length;
	return this.iterator(node);
};

TestList.prototype.unshift = function (value) {
	return this.insertAfter(this.begin(), value);
};

TestList.prototype.push = function (value) {
	return this.insertBefore(this.end(), value);
};

TestList.prototype.erase = function (iterator) {
	const node = iterator.current;

	node.prev.next = node.next;
	node.next.prev = node.prev;

	--this.length;
	return this.iterator(node.next);
};

TestList.prototype.rerase = function (iterator) {
	const node = iterator.current;

	node.next.prev = node.prev;
	node.prev.next = node.next;

	--this.length;
	return this.iterator(node.prev);
};

TestList.prototype.eraserange = function (first, last) {
	const firstnode = first.current;
	const lastnode = last.current;

	lastnode.prev = firstnode.prev;
	firstnode.prev.next = lastnode;

	const it = first.copy();

	while (it.current !== lastnode) {
		--this.length;
		it.next();
	}

	return last.copy();
};

TestList.prototype.reraserange = function (first, last) {
	const firstnode = first.current;
	const lastnode = last.current;

	lastnode.next = firstnode.next;
	firstnode.next.prev = lastnode;

	const it = first.copy();

	while (it.current !== lastnode) {
		--this.length;
		it.next();
	}

	return last.copy();
};

TestList.prototype.shift = function () {
	const it = this.begin();
	const e = it.next();

	if (e.done) {
		return null;
	}

	this.rerase(it);
	return e.value;
};

TestList.prototype.pop = function () {
	const it = this.rbegin();
	const e = it.next();

	if (e.done) {
		return null;
	}

	this.erase(it);
	return e.value;
};

TestList.prototype.clear = function () {
	this.front.next = this.back;
	this.back.prev = this.front;
	this.length = 0;
	return this;
};

TestList.prototype.iterator = function (node) {
	return new Iterator(this.front, this.back, node);
};

TestList.prototype.riterator = function (node) {
	return new ReverseIterator(this.front, this.back, node);
};

TestList.prototype.begin = function () {
	return this.iterator(this.front);
};

TestList.prototype.end = function () {
	return this.iterator(this.back);
};

TestList.prototype.rbegin = function () {
	return this.riterator(this.back);
};

TestList.prototype.rend = function () {
	return this.riterator(this.front);
};

Iterator.prototype.copy = function () {
	return new Iterator(this.front, this.back, this.current);
};

ReverseIterator.prototype.copy = function () {
	return new ReverseIterator(this.front, this.back, this.current);
};

// eslint-disable-next-line no-multi-assign
Iterator.prototype.next = ReverseIterator.prototype.prev = function () {
	this.current = this.current.next;
	if (this.current === this.back) {
		return {done: true};
	}

	return {
		value: this.current.value,
		done: false,
	};
};

// eslint-disable-next-line no-multi-assign
Iterator.prototype.prev = ReverseIterator.prototype.next = function () {
	this.current = this.current.prev;
	if (this.current === this.front) {
		return {done: true};
	}

	return {
		value: this.current.value,
		done: false,
	};
};

TestList.Node = Node;
TestList.Iterator = Iterator;
TestList.ReverseIterator = ReverseIterator;

export function test(_test, name, List) {
	const listToArrayForward = function (list) {
		const array = [];

		const it = list.begin();

		let e;

		while (!(e = it.next()).done) {
			array.push(e.value);
		}

		return array;
	};

	const listToArrayBackward = function (list) {
		const array = [];

		const it = list.rbegin();

		let e;

		while (!(e = it.next()).done) {
			array.push(e.value);
		}

		return array;
	};

	_test(name, (t) => {
		let i;
		let n;
		let m;
		let a;
		let b;
		let v;
		let first;
		let last;

		const list = new List();

		t.deepEqual(list.length, 0, 'length is 0');

		const expectedArrayForward = [];
		const expectedArrayBackward = [];

		let arrayForward = [];
		let arrayBackward = [];

		const add20 = function () {
			n = 10;

			for (i = 1; i <= n; ++i) {
				list.push(i);
				expectedArrayForward.push(i);
				expectedArrayBackward.unshift(i);
				t.deepEqual(list.length, i, 'length is ' + i);

				arrayForward = listToArrayForward(list);
				arrayBackward = listToArrayBackward(list);

				t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
				t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');
			}

			n = 20;

			for (; i <= n; ++i) {
				list.unshift(i);
				expectedArrayForward.unshift(i);
				expectedArrayBackward.push(i);
				t.deepEqual(list.length, i, 'length is ' + i);

				arrayForward = listToArrayForward(list);
				arrayBackward = listToArrayBackward(list);

				t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
				t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');
			}
		};

		const del20 = function () {
			n = 10;

			for (i = 20; i > n; --i) {
				t.deepEqual(list.length, i, 'length is ' + i);

				v = list.pop();
				a = expectedArrayForward.pop();
				b = expectedArrayBackward.shift();
				t.deepEqual(v, a, 'popped value a === ' + a);
				t.deepEqual(v, b, 'popped value b === ' + a);

				arrayForward = listToArrayForward(list);
				arrayBackward = listToArrayBackward(list);

				t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
				t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');
			}

			n = 0;

			for (; i > n; --i) {
				t.deepEqual(list.length, i, 'length is ' + i);

				v = list.shift();
				a = expectedArrayForward.shift();
				b = expectedArrayBackward.pop();
				t.deepEqual(v, a, 'shifted value a === ' + a);
				t.deepEqual(v, b, 'shifted value b === ' + a);

				arrayForward = listToArrayForward(list);
				arrayBackward = listToArrayBackward(list);

				t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
				t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');
			}
		};

		const clear = function () {
			list.clear();
			expectedArrayForward.splice(0);
			expectedArrayBackward.splice(0);
		};

		clear();
		add20();
		del20();

		t.deepEqual(list.length, 0, 'length is 0');

		v = list.shift();
		t.deepEqual(v, null, 'v === null');

		v = list.pop();
		t.deepEqual(v, null, 'v === null');

		t.deepEqual(list.length, 0, 'length is 0');

		clear();
		add20();

		clear();

		t.deepEqual(list.length, 0, 'length is 0');

		arrayForward = listToArrayForward(list);
		arrayBackward = listToArrayBackward(list);

		t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
		t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');

		clear();
		add20();

		first = list.begin();
		last = list.end();
		first.next();

		list.eraserange(first, last);
		expectedArrayForward.splice(0);
		expectedArrayBackward.splice(0);

		t.deepEqual(list.length, 0, 'length is 0');

		arrayForward = listToArrayForward(list);
		arrayBackward = listToArrayBackward(list);

		t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
		t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');

		clear();
		add20();

		first = list.rbegin();
		last = list.rend();
		first.next();

		list.reraserange(first, last);
		expectedArrayForward.splice(0);
		expectedArrayBackward.splice(0);

		t.deepEqual(list.length, 0, 'length is 0');

		arrayForward = listToArrayForward(list);
		arrayBackward = listToArrayBackward(list);

		t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
		t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');

		clear();
		add20();

		m = 5;

		first = list.begin();
		last = list.end();
		first.next();
		for (i = 0; i < m; ++i) {
			first.next();
			last.prev();
		}

		list.eraserange(first, last);
		expectedArrayForward.splice(m, n - m - m);
		expectedArrayBackward.splice(m, n - m - m);

		t.deepEqual(list.length, expectedArrayForward.length, 'length check');
		t.deepEqual(list.length, expectedArrayBackward.length, 'length check');

		arrayForward = listToArrayForward(list);
		arrayBackward = listToArrayBackward(list);

		t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
		t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');

		clear();
		add20();

		m = 5;

		first = list.rbegin();
		last = list.rend();
		first.next();
		for (i = 0; i < m; ++i) {
			first.next();
			last.prev();
		}

		list.reraserange(first, last);
		expectedArrayForward.splice(m, n - m - m);
		expectedArrayBackward.splice(m, n - m - m);

		t.deepEqual(list.length, expectedArrayForward.length, 'length check');
		t.deepEqual(list.length, expectedArrayBackward.length, 'length check');

		arrayForward = listToArrayForward(list);
		arrayBackward = listToArrayBackward(list);

		t.deepEqual(arrayForward, expectedArrayForward, 'content is equal');
		t.deepEqual(arrayBackward, expectedArrayBackward, 'content is equal');
	});
}

